import {React,useState} from "react"
function Addtocart(){
    const [Cart,setCart] = useState(0)

    const click = () =>{
        setCart(Cart+1)
    }

    const setclick =() =>{
        setCart(Cart-1)
    }
    return(
        <div>
            <center>
                <h1>Add : {Cart}</h1>
                <button onClick={click}>+</button>
                <button onClick={setclick}>-</button>
            </center>
        </div>
    )
}

export default Addtocart
